var customSorterSchool = function(obj) {
  if (!obj.dateRange) {
    return 0;
  }
  var startDate = new Date(obj.dateRange.substring(0, 4)).getTime();
  return startDate;
};

var customSorterJobs = function(obj) {
  if (!obj.dateRange) {
    return 0;
  }
  var startDate = new Date(obj.dateRange.substring(0, 8)).getTime();
  return startDate;
};

profilesCurricular.forEach(sc => {
  sc.schools = _.sortBy(sc.schools, customSorterSchool);
});
profilesCurricular.forEach(sc => {
  sc.jobs = _.sortBy(sc.jobs, customSorterJobs);
});
profilesCurricular.forEach(sc => {
  sc = delete sc.details;
});
profilesCurricular.forEach(sc => {
  sc = delete sc.general;
});

profilesCurricular.forEach(sc => {
  sc["curriculumSchools"] = [];
  sc.schools.splice(0, 0, {
    schoolName: "0",
    degreeSpec: "Baccalauréat"
  });
  if (sc.schools.length > 0) {
    for (var i = 0; i < sc.schools.length - 1; i++) {
      sc.curriculumSchools.push({
        from: {
          schoolName: sc.schools[i].schoolName,
          degree: sc.schools[i].degreeSpec
        },
        to: {
          schoolName: sc.schools[i + 1].schoolName,
          degree: sc.schools[i + 1].degreeSpec
        }
      });
    }
  }
});

profilesCurricular.forEach(sc => {
  sc["curriculumJobs"] = [];
  sc.jobs.splice(0, 0, {
    companyName: "0",
    jobTitle: "Freshman"
  });
  if (sc.schools.length > 0) {
    for (var i = 0; i < sc.jobs.length - 1; i++) {
      sc.curriculumJobs.push({
        from: {
          company: sc.jobs[i].companyName,
          title: sc.jobs[i].jobTitle
        },
        to: {
          company: sc.jobs[i + 1].companyName,
          title: sc.jobs[i + 1].jobTitle
        }
      });
    }
  }
});
profilesCurricular.forEach(sc => {
  sc = delete sc.schools;
});
profilesCurricular.forEach(sc => {
  sc = delete sc.jobs;
});
profilesCurricular.forEach(sc => {
  sc = delete sc.allSkills;
});

const mongoose = require("mongoose");
const ProfileCurricular = require("../models/ProfileCurricular");

mongoose
  .connect("mongodb://localhost/ih-educstrat", { useNewUrlParser: true })
  .then(x => {
    console.log(
      `Connected to Mongo! Database name: "${x.connections[0].name}"`
    );
    return ProfileCurricular.remove();
  })
  .then(x => {
    return ProfileCurricular.create(profilesCurricular);
  })
  .then(x => {
    console.log("All users have been created");
    mongoose.connection.close();
  })
  .catch(err => {
    console.error("Error connecting to mongo", err);
    mongoose.connection.close();
  });
